import { StyleSheet } from "react-native";

const estilo = StyleSheet.create({
    header: {
        backgroundColor: "gray",
        textAlign: "center",
        padding: 10,
    },
    imagem:{
        width:100,
        height:100,
    },
    card:{
        width:220,
        borderWidth: 1,
        borderColor: "black",
    }

})

export {estilo}
